import {
  StarIcon,
  ArrowPathIcon,
  FingerPrintIcon,
} from "@heroicons/react/24/solid";

export const featuresData = [
  {
    color: "blue",
    title: "Búsqueda de hoteles",
    icon: StarIcon,
    description:
      "Contamos con una potente función de búsqueda que te permite encontrar hoteles en cualquier destino que desees. Puedes filtrar los resultados por ubicación, precio, categoría de hotel, servicios ofrecidos y puntuaciones de los huéspedes. ",
  },
  {
    color: "red",
    title: "Free Revisions",
    icon: ArrowPathIcon,
    description:
      "Keep you user engaged by providing meaningful information. Remember that by this time, the user is curious.",
  },
  {
    color: "teal",
    title: "Verified Company",
    icon: FingerPrintIcon,
    description:
      "Write a few lines about each one. A paragraph describing a feature will be enough. Keep you user engaged!",
  },
];

export default featuresData;
